import React from 'react';

const HomePage =()=>{
  return (
    <div>
      <p>I'm a full-stack software engineer with 4+ years of hands-on professional experience 
        in software development, process improvement, on-time delivery of projects, with strong front-end 
        and backend development experience.
         Self-motivated & committed individual who loves challenges, quick to learn, and appreciates feedback.</p>
      <p>I'm currently at TalentUp Africa, leading the backend team that's building a recruitment software to enable
        a more efficient, objective, easier and faster way of recruiting quality talent.</p>
      <p>

      </p>

    </div>
  )
}

export default HomePage;
